/* Exemplo de estilo personalizado para https://example.com */
body {
    background-color: #2c3e50; /* Cor de fundo escura */
    color: #ecf0f1; /* Cor do texto clara */
}

a {
    color: #e74c3c; /* Alterar a cor dos links para vermelho */
}

h1, h2, h3 {
    font-family: 'Arial', sans-serif; /* Alterar a fonte dos títulos */
}

header {
    display: none; /* Ocultar o cabeçalho do site */
}
